import CircleImage from '../circleImage/CircleImage'
import Card from './Card'
import './Element.css'

const Element = (props) => {
  const logoContainer =  <CircleImage imagePath={props.logo} alt={'Logo'} width={80} height={80}/>;
  const descriptionCard = <Card />;
  let component;

  if(props.side === 'left') {
    component = <>
          {descriptionCard}
          {logoContainer}
      </>;
  } else {
    component = <>
      {logoContainer}
      {descriptionCard}</>;
  }

  return (
    <div className='timelineElement'>
      {component}
    </div>
  )
}

export default Element;
